def fdtd_2d_part1(nx: int, ny: int, ey: List[List[int]], hz: List[List[int]]) -> List[List[int]]:
    return matrix_elemwise_sub(
        matrix_row_slice(ey, 1, nx),
        matrix_scalar_mul(5, 
            matrix_elemwise_sub(
                matrix_row_slice(hz, 1, nx),
                matrix_row_slice(hz, 0, nx - 1)
            )
        )
    )
